package K1;

import battlecode.common.Direction;
import battlecode.common.GameConstants;
import battlecode.common.MapLocation;
import battlecode.common.RobotController;
import battlecode.common.RobotType;

/** The example funcs player is a player meant to demonstrate basic usage of the most common commands.
 * Robots will move around randomly, occasionally mining and writing useless messages.
 * The HQ will spawn soldiers continuously. 
 */
public class RobotPlayer {
	public static void run(RobotController rc) {
		while (true) {
			try {
				if (rc.getType() == RobotType.HQ) {
					if (rc.isActive()) {
						// Spawn a soldier
						Direction dir = rc.getLocation().directionTo(rc.senseEnemyHQLocation());
						if (rc.canMove(dir))
							rc.spawn(dir);
					}
				} else if (rc.getType() == RobotType.SOLDIER) {
					if (rc.isActive()) {
						if (Math.random()<0.0) {
							// Lay a mine 
							if(rc.senseMine(rc.getLocation())==null)
								rc.layMine();
						} else { 
							// Choose a random direction, and move that way if possible
							MapLocation enemyHQ = rc.senseEnemyHQLocation();
							Direction dir = rc.getLocation().directionTo(enemyHQ);
							float dist = rc.getLocation().distanceSquaredTo(enemyHQ);
							if((dist < 100 && Math.random()<0.3) || (dist < 800 && Math.random()<0.07)){
								if(Math.random() < 0.5){
									dir = dir.rotateLeft();
								} else {
									dir = dir.rotateRight();
								}
							}
							
							MapLocation next = rc.getLocation().add(dir);
							
							if(rc.canMove(dir)) {
								if(rc.senseMine(next) != null){
									rc.defuseMine(next);
								}
								else{
								rc.move(dir);
								rc.setIndicatorString(0, "Last direction moved: "+dir.toString());
								}
							}
						}
					}
					/*
					if (Math.random()<0.01 && rc.getTeamPower()>5) {
						// Write the number 5 to a position on the message board corresponding to the robot's ID
						rc.broadcast(rc.getRobot().getID()%GameConstants.BROADCAST_MAX_CHANNELS, 5);
					}
					*/
				}

				// End turn
				rc.yield();
			} catch (Exception e) {
				e.printStackTrace();
			}
		}
	}
}

