import battlecode.common.RobotType;
import battlecode.common.Team;

public class RobotPlayer {
	public static void run(RobotController rc) {
		while (true) {
			
			Team myTeam = null;
			Team enemyTeam = null;
			
			if (rc.getTeam() == Team.A){
				myTeam = Team.A;
				enemyTeam = Team.B;
			}
			else {
				myTeam = Team.B;
				enemyTeam = Team.A;
			}

			try {
				if (rc.getType() == RobotType.HQ) {
					if (rc.isActive()) {
						// Spawn a soldier
						Direction dir = rc.getLocation().directionTo(rc.senseEnemyHQLocation());
						if (rc.canMove(dir))
							rc.spawn(dir);
					}
				}
				
				else if (rc.getType() == RobotType.SOLDIER) {
					if (rc.isActive()) {
						Direction dir = rc.getLocation().directionTo(rc.senseEnemyHQLocation());
						double randomThreshold = randomThreshold(rc.getLocation().distanceSquaredTo(rc.senseEnemyHQLocation()));
						if (Math.random() < randomThreshold){
							if (Math.random() < 0.5){
								dir = dir.rotateLeft();
							}
							else {
								dir = dir.rotateRight();
							}
						}
						else {
							dir = rc.getLocation().directionTo(rc.senseEnemyHQLocation());
						}
						// check if that square has a mine
						MapLocation next = rc.getLocation().add(dir);
						
						Team mineOwner = rc.senseMine(next);
						
						if (mineOwner == Team.NEUTRAL || mineOwner == enemyTeam){
							rc.defuseMine(next);
						}
						else {
							if(rc.canMove(dir)) {
								rc.move(dir);
								rc.setIndicatorString(0, "Last direction moved: "+dir.toString());
							}
						}
					}
				}

				// End turn
				rc.yield();
			} catch (Exception e) {
				e.printStackTrace();
			}
		}
	}

	private static double randomThreshold(int distance){
		double scaled_distance = distance / 500.0;
		if (scaled_distance > 1){
			return 0.0;
		}
		else if (scaled_distance > 0.5){ // distance between 50 and 100
			return 1 - scaled_distance;
		}
		else {
			return scaled_distance;
		}
	}
}

